import React, { Fragment } from 'react';

export const Person = ({name, children, age, clickHandler}) => (
  <Fragment>
    <p onClick={() => clickHandler()}>Name: {name} and Age: {age}</p>
    <p>{children}</p>
  </Fragment>
)

export default Person;
